import Button from "../gov-uk-components/Button";
import Footer from "../gov-uk-components/Footer";
import Header from "../gov-uk-components/Header";
import TextInput from "../gov-uk-components/TextInput";
import { useState } from "react";

export default function SignUpPage() {
  const [username, setUsername] = useState("");
  const [password, SetPassword] = useState("");

  return (
    <>
      <Header />
      <div class="govuk-width-container">
        <br />
        <p class="govuk-heading-m">Sign up</p>
        <form method="post" action="http://localhost:3000/signup">
          <TextInput name={"Email Address"} value={username} />
          <TextInput name={"Password"} value={password} />
          <Button text={"Submit"} className={"govuk-button"} />
        </form>
      </div>
      <Footer />
    </>
  );
}
